model_class: TorchModel
input_variables:
  z_target_um:
    variable_class: ScalarVariable
    default_value: 0.1
    is_constant: false
    value_range: [-150.0, 150.0]
    value_range_tolerance: 1.0e-08
  TOD_fs3:
    variable_class: ScalarVariable
    default_value: 0.1
    is_constant: false
    value_range: [-80000.0, 80000.0]
    value_range_tolerance: 1.0e-08
  GVD:
    variable_class: ScalarVariable
    default_value: 13.5
    is_constant: false
    value_range: [13.2, 13.9]
    value_range_tolerance: 1.0e-08
output_variables:
  n_protons:
    variable_class: ScalarVariable
    default_value: 0.0
    is_constant: false
    value_range: [0.0, 80000000000.0]
    value_range_tolerance: 1.0e-08
input_validation_config: null
output_validation_config: null
model: base_simulation_model_with_transformers_new_model.pt
input_transformers: [base_simulation_model_with_transformers_new_input_transformers_0.pt]
output_transformers: [base_simulation_model_with_transformers_new_output_transformers_0.pt,
  base_simulation_model_with_transformers_new_output_transformers_1.pt]
output_format: tensor
device: cpu
fixed_model: true
precision: double
